import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'

class Header extends Component {
  render() {
    return (
      <div data-component="header">

        <div className="container-page hidden">

          <div data-track-header>

            <div data-logo>
              <i></i> OliveiraCap
            </div>

            <ul>
              <li>

                <span></span>
                <span></span>
              </li>
            </ul>

          </div>

        </div>
      </div>
    );
  }
}
export default Header;
